	add("boredom", "{\"term\":\"boredom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|bore|dom|lang\u003den}}. First attested in the novel \u0027Bleak House\u0027, written in 1852 by {{w|Charles Dickens}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being bored\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1852\u0027\u0027, , s:Bleak House/Chapter Chapter XI\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"only last Sunday, my Lady, in the desolation of \u0027\u0027Boredom\u0027\u0027 and the clutch of Giant Despair, almost hated her own maid for being in spirits\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An instance or period of a state of being bored; a variety of bored state\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, w:Martin Martin Heidegger, William McNeill, Nicholas Walker (translators), \u0027The Fundamental Concepts of Metaphysics: World, Finitude, Solitude\u0027, [http://books.google.com/books?id\u003dZYU9tyb4K2wC\u0026amp;pg\u003dPA107\u0026amp;dq\u003d%22a+boredom%22\u0026amp;hl\u003den\u0026amp;ei\u003dvu_tTZ2xPIukvgOy84S0Bg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d8\u0026amp;ved\u003d0CEsQ6AEwB\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22a%20boredom%22\u0026amp;f\u003dfalse page 107\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If we are seeking a more original conception of boredom then we must also correspondingly endeavour to envisage a \u0027more original form\u0027 of boredom, thus presumably a \u0027\u0027boredom\u0027\u0027 in which we become more \u0027bored\u0027 than in the situation we have characterized\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Michael L. Raposa, \u0027Boredom and the Religious Imagination\u0027, [http://books.google.com/books?id\u003dm8RwV5p5_LIC\u0026amp;pg\u003dPA58\u0026amp;dq\u003d%22a+boredom%22\u0026amp;hl\u003den\u0026amp;ei\u003dvu_tTZ2xPIukvgOy84S0Bg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d9\u0026amp;ved\u003d0CFAQ6AEwC\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22a%20boredom%22\u0026amp;f\u003dfalse page 58\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Yet that earlier characterization was of a kind of boredom that can be portrayed as resembling acedia; that is, a \u0027\u0027boredom\u0027\u0027 that I can be held responsible for, either in its genesis or its persistence\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"See more citations at boredoms\", \"priority\":11}]}, \"synonyms\":{}}");

